static setProperty(...) {
    if (atomic) {
        spinlock_t& slotlock = PropertyLocks[slot];
        slotlock.lock();
        oldValue = *slot;
        *slot = newValue;        
        slotlock.unlock();
    } else {
        oldValue = *slot;
        *slot = newValue;
    }
}

static id objc_getProperty(...) {
    id *slot = (id*) ((char*)self + offset);
    if (!atomic) return *slot;  // nonatomic

    // Atomic retain release world
    spinlock_t& slotlock = PropertyLocks[slot];
    slotlock.lock();
    id value = objc_retain(*slot);
    slotlock.unlock();

    return value;
}

